    <div>
    <p class=MsoNormal><span style='font-size:10.5pt;line-height:105%;
    font-family:"Arial",sans-serif;color:#202122;background:white'>concepto
    geográfico de Europa, amén de un significado consensuado sE qué comprende
    la &quot;</span><a href="https://es.wikipedia.org/wiki/Europe%C3%ADsmo"
    title=Europeísmo><span style='font-size:10.5pt;line-height:105%;font-family:
    "Arial",sans-serif;color:#3366CC;background:white'>europeidad</span></a><span
    style='font-size:10.5pt;line-height:105%;font-family:"Arial",sans-serif;
    color:#202122;background:white'>&quot;, ha tenido muchos y diversos
    significados a lo largo de la historia. Han sido debatidas sus fronteras
    físicas a la par de su concepto político y cultural asociado a la idea de
    Europa. Durante 2500 años ha sido un área dividida y disputada. A pesar de
    las diferencias se intentaron establecer objetivos precisos para la entidad
    europea con el fin de lograr cierta homogeneidad dentro de la
    heterogeneidad del continente.</span><span style='font-size:12.0pt;
    mso-bidi-font-size:11.0pt;line-height:105%'><o:p></o:p></span></p>
    </div>
    <![if !mso]></td>
